import React from 'react';
import "./Footer.css"

const Footer = () => {
  const currentYear = new Date().getFullYear();

  return (
    <footer>
      <p style={{backgroundColor: "#222E34"}}>&copy; Copyright {currentYear} Bhive Private Limited. All rights reserved.</p>
    </footer>
  );
}

export default Footer;
